import React from 'react';
import styled from 'styled-components';

const Figure = styled.img`
    background: 50% 50% no-repeat;
    background-size: cover;
`;

const Logo: React.FC = () => {
    return <Figure style="background-image: url('./src/images/frmwrk_logo.svg')">
    </Figure>
};

export default Logo;
